                    if (id.startsWith('highlight-dialog-')) {
                        const index = id.split('-')[2];
                        const progressBar = document.getElementById('highlight-progress-' + index);
                        if (progressBar) {
                            progressBar.style.transition = 'none';
                            progressBar.style.width = '0%';
                            setTimeout(() => {
                                progressBar.style.transition = 'width 5s linear';
                                progressBar.style.width = '100%';
                            }, 10);
                        }
                        if (highlightTimers[id]) clearTimeout(highlightTimers[id]);
                        highlightTimers[id] = setTimeout(() => closeDialog(id), 5000);
                    }
                }
            }
            function closeDialog(id) {
                const dialog = document.getElementById(id);
                if (dialog) {
                    dialog.style.display = 'none';
                    const video = dialog.querySelector('video');
                    if (video) {
                        video.pause();
                    }
                    if (id.startsWith('highlight-dialog-')) {
                        if (highlightTimers[id]) {
                            clearTimeout(highlightTimers[id]);
                            delete highlightTimers[id];
                        }
                        const index = id.split('-')[2];
                        const progressBar = document.getElementById('highlight-progress-' + index);
                        if (progressBar) {
                            progressBar.style.transition = 'none';
                            progressBar.style.width = '0%';
                        }
                    }
                }
            }
            document.querySelectorAll('a[onclick]').forEach(el => {
                el.addEventListener('click', e => e.preventDefault());
            });

            document.addEventListener('DOMContentLoaded', () => {
                setTimeout(() => {
                    const loadingScreen = document.getElementById('loading-screen');
                    if (loadingScreen) {
                        loadingScreen.style.display = 'none';
                    }
                }, 800);
                
                const geoElements = document.querySelectorAll('[data-geospoof="true"]');
                if (geoElements.length > 0) {
                    fetch('https://ipapi.co/json/')
                        .then(res => res.json())
                        .then(data => {
                            const location = data.city && data.country_name ? `${data.city}, ${data.country_name}` : 'Unknown Location';
                            geoElements.forEach(el => {
                                el.textContent = el.textContent.replace(/GEOSPOOF/g, location);
                            });
                        })
                        .catch(() => {
                            const location = 'Unknown Location';
                            geoElements.forEach(el => {
                                el.textContent = el.textContent.replace(/GEOSPOOF/g, location);
                            });
                        });
                }
            });
        
                </script>
            </body>
            </html>
